const Part = (props) => {
    return (
        <p>
            {props.part} {props.exercises}
        </p>
    )
}


const Content = (props) => {
    return (
        <div>
            <Part part={props.part[0]} exercises={props.exercises1} />
            <Part part={props.part2} exercises={props.exercises2} />
            <Part part={props.part3} exercises={props.exercises3} />
        </div>
    )
}

export default Content;
